import React from "react"
import './App.css';
import GameButton from "./packages/GameButton";

const App = () => {
  const createPositions = () => {
    let board = [];
    for (let i = 0; i < 3; i++) {
      for (let j = 0; j < 3; j++) {
      board.push({x: i, y: j})
      }
    }
    return board
  }


  return (
    <div className="App">
      {createPositions().map(singlePosition => (<GameButton label={singlePosition} position={singlePosition}/> ))}
    </div>
  );
}

export default App;
